import { useState } from 'react';
import { Button } from '@mui/material';
import axios from 'axios';

const Withdraw = ({ userId }) => {
  const [amount, setAmount] = useState('');

  const handleWithdraw = async () => {
    try {
      const response = await axios.post('/api/withdraw', { userId, amount });
      alert('Withdraw request created successfully!');
    } catch (error) {
      alert('Failed to create withdraw request');
    }
  };

  return (
    <div>
      <input
        type="number"
        value={amount}
        onChange={(e) => setAmount(e.target.value)}
        placeholder="Enter withdraw amount"
      />
      <Button variant="contained" color="secondary" onClick={handleWithdraw}>
        Request Withdrawal
      </Button>
    </div>
  );
};

export default WithdrawButton;
